import React, {Component} from "react";
import { connect } from 'react-redux';

class NewComp extends Component{
    

    styles ={
        fontStyle: "italic",
        color: "purple",
    };

    ButtonChange = () => {
        this.setState({
            message: 'Looks like it worked'
        })
    }

    render(){
        return(
            <div className="App">
                <h3 style={this.styles}>{this.state.message}</h3>
                <button onClick={this.ButtonChange}>Check</button>
            </div>
        )
    }
}

export default NewComp;
